import React from 'react';

class Nav extends React.Component {

  render() {
    return(
      <div className="row">
        <div className="col-4">{this.props.username}</div>
        <div className="col-8">
          <button onClick={this.props.onViewChange}>New</button>
          <button onClick={this.props.onViewChange}>View</button>
        </div>
        <div className="col-4"></div>
      </div>
    )
  }

}

export default Nav;
